import React from 'react';
import {
    Container,
    Card,
    CardContent,
    Typography,
    Box,
    Grid,
    Button,
    Divider,
    makeStyles
} from '@material-ui/core';
import {
    CheckCircle as CorrectIcon,
    Cancel as WrongIcon,
    Timeline as AnalyticsIcon,
    GetApp as DownloadIcon,
    Replay as RetryIcon
} from '@material-ui/icons';
import { useHistory, useLocation } from 'react-router-dom';

const useStyles = makeStyles((theme) => ({
    root: {
        minHeight: '100vh',
        backgroundColor: '#f5f5f5',
        paddingTop: theme.spacing(4),
        paddingBottom: theme.spacing(4),
    },
    card: {
        borderRadius: 16,
        boxShadow: '0 4px 24px 0 rgba(34, 41, 47, 0.1)',
        overflow: 'hidden',
    },
    header: {
        background: 'linear-gradient(135deg, #6B8DD6 0%, #8E37D7 100%)',
        color: 'white',
        padding: theme.spacing(3),
    },
    content: {
        padding: theme.spacing(3),
    },
    scoreCard: {
        textAlign: 'center',
        padding: theme.spacing(3),
        backgroundColor: '#EDF2FF',
        borderRadius: 12,
        marginBottom: theme.spacing(3),
    },
    score: {
        fontSize: '3rem',
        fontWeight: 700,
        color: '#2D3748',
        marginBottom: theme.spacing(1),
    },
    questionCard: {
        padding: theme.spacing(2),
        marginBottom: theme.spacing(2),
        borderRadius: 12,
        border: '1px solid #E2E8F0',
    },
    correct: {
        color: '#48BB78',
    },
    wrong: {
        color: '#F56565',
    },
    button: {
        borderRadius: 12,
        padding: '12px 24px',
        textTransform: 'none',
        fontWeight: 600,
        fontSize: '1rem',
        marginRight: theme.spacing(2),
    },
    analyticsSection: {
        marginTop: theme.spacing(4),
    },
    statCard: {
        padding: theme.spacing(2),
        textAlign: 'center',
        backgroundColor: 'white',
        borderRadius: 12,
        boxShadow: '0 2px 12px rgba(0,0,0,0.08)',
    }
}));

const Result = () => {
    const classes = useStyles();
    const history = useHistory();
    const location = useLocation();
    const { results } = location.state || { results: null };

    if (!results) {
        history.push('/');
        return null;
    }

    const calculateScore = () => {
        let totalCorrect = 0;
        let totalPoints = 0;
        let maxPoints = 0;

        results.questions.forEach((question, index) => {
            maxPoints += question.points;
            const userAnswers = results.answers[question.id] || {};
            const isCorrect = question.blanks.every((blank) => 
                userAnswers[blank.id]?.toLowerCase() === blank.correctAnswer.toLowerCase()
            );
            if (isCorrect) {
                totalCorrect++;
                totalPoints += question.points;
            }
        });

        return {
            totalCorrect,
            totalQuestions: results.questions.length,
            totalPoints,
            maxPoints,
            percentage: Math.round((totalPoints / maxPoints) * 100)
        };
    };

    const score = calculateScore();

    const handleRetry = () => {
        history.push('/');
    };

    const handleDownloadCertificate = () => {
        // Implement certificate download logic
        console.log('Downloading certificate...');
    };

    return (
        <Box className={classes.root}>
            <Container maxWidth="lg">
                <Card className={classes.card}>
                    <Box className={classes.header}>
                        <Typography variant="h4" gutterBottom>
                            Quiz Results
                        </Typography>
                        <Typography variant="subtitle1">
                            Here's how you performed
                        </Typography>
                    </Box>

                    <CardContent className={classes.content}>
                        <Box className={classes.scoreCard}>
                            <Typography className={classes.score}>
                                {score.percentage}%
                            </Typography>
                            <Typography variant="h6" gutterBottom>
                                Total Score: {score.totalPoints}/{score.maxPoints} points
                            </Typography>
                            <Typography variant="subtitle1">
                                {score.totalCorrect} out of {score.totalQuestions} questions correct
                            </Typography>
                        </Box>

                        <Grid container spacing={3} className={classes.analyticsSection}>
                            <Grid item xs={12} md={4}>
                                <Box className={classes.statCard}>
                                    <Typography variant="h6" gutterBottom>
                                        Time Spent
                                    </Typography>
                                    <Typography variant="h4">
                                        {Math.floor(results.timeSpent / 60)}:{(results.timeSpent % 60).toString().padStart(2, '0')}
                                    </Typography>
                                    <Typography variant="subtitle2" color="textSecondary">
                                        Minutes
                                    </Typography>
                                </Box>
                            </Grid>
                            <Grid item xs={12} md={4}>
                                <Box className={classes.statCard}>
                                    <Typography variant="h6" gutterBottom>
                                        Accuracy
                                    </Typography>
                                    <Typography variant="h4">
                                        {Math.round((score.totalCorrect / score.totalQuestions) * 100)}%
                                    </Typography>
                                    <Typography variant="subtitle2" color="textSecondary">
                                        Correct Answers
                                    </Typography>
                                </Box>
                            </Grid>
                            <Grid item xs={12} md={4}>
                                <Box className={classes.statCard}>
                                    <Typography variant="h6" gutterBottom>
                                        Performance
                                    </Typography>
                                    <Typography variant="h4">
                                        {score.percentage >= 70 ? 'Excellent' : score.percentage >= 50 ? 'Good' : 'Need Practice'}
                                    </Typography>
                                    <Typography variant="subtitle2" color="textSecondary">
                                        Overall Rating
                                    </Typography>
                                </Box>
                            </Grid>
                        </Grid>

                        <Box mt={4}>
                            <Typography variant="h6" gutterBottom>
                                Detailed Review
                            </Typography>
                            {results.questions.map((question, index) => {
                                const userAnswers = results.answers[question.id] || {};
                                const isCorrect = question.blanks.every((blank) => 
                                    userAnswers[blank.id]?.toLowerCase() === blank.correctAnswer.toLowerCase()
                                );

                                return (
                                    <Box key={question.id} className={classes.questionCard}>
                                        <Grid container spacing={2}>
                                            <Grid item xs={12}>
                                                <Typography variant="subtitle1">
                                                    Question {index + 1}
                                                    {isCorrect ? (
                                                        <CorrectIcon className={classes.correct} />
                                                    ) : (
                                                        <WrongIcon className={classes.wrong} />
                                                    )}
                                                </Typography>
                                                <Typography>{question.text}</Typography>
                                            </Grid>
                                            {question.blanks.map((blank) => (
                                                <Grid item xs={12} key={blank.id}>
                                                    <Typography>
                                                        Your answer: {userAnswers[blank.id] || 'No answer'}
                                                    </Typography>
                                                    <Typography className={classes.correct}>
                                                        Correct answer: {blank.correctAnswer}
                                                    </Typography>
                                                </Grid>
                                            ))}
                                        </Grid>
                                    </Box>
                                );
                            })}
                        </Box>

                        <Divider style={{ margin: '24px 0' }} />

                        <Box>
                            <Button
                                variant="contained"
                                color="primary"
                                className={classes.button}
                                startIcon={<RetryIcon />}
                                onClick={handleRetry}
                            >
                                Try Another Quiz
                            </Button>
                            <Button
                                variant="outlined"
                                color="primary"
                                className={classes.button}
                                startIcon={<DownloadIcon />}
                                onClick={handleDownloadCertificate}
                            >
                                Download Certificate
                            </Button>
                        </Box>
                    </CardContent>
                </Card>
            </Container>
        </Box>
    );
};

export default Result;
